import React, { useEffect, useState } from 'react';

function VitaminCard({vitamin}){
    return (
        <div className="card">
            <div className="card-block">
                <h4 className="card-title">{vitamin.product.name}</h4>
                <p className="card-text">{vitamin.product.price}</p>
                <p className="card-text">{vitamin.weight}</p>
            </div>
        </div>
    );
}

export default VitaminCard;
